import {useState} from 'react'

const SessionsList = (props) => {
    const running = props.sessions;
    console.log(props)

    return ( 
    <div className="session-list">
    {running.map((ses) => (
       <div className="preview" key={ses.id}>
        <h3>Titel: {ses.title} </h3>
        <p> Prof: {ses.prof}</p>
        </div> 
        ))}
    </div> 
);
}

export default SessionsList;
